<div class="entities" style="line-height: 2.5; direction: ltr">Evidence of drug-drug interactions through uptake and efflux transport systems in rat hepatocytes : implications for cellular concentrations of competing drugs . For drugs with hepatobiliary transport across hepatocytes , the interplay between uptake and efflux transporters determines hepatic concentrations of drugs , but the evolution over time of these concentrations is difficult to measure in humans other than with magnetic resonance imaging contrast agents in the liver . DB00743 dimeglumine ( BOPTA ) is a contrast agent used in liver magnetic resonance imaging that enters into human hepatocytes through organic anion transporting polypeptides (

 ) and exits unchanged into bile through the multiple resistance-associated protein 2 (
